const Popup = ({text, options, confirmationFun, cancleFun}) => {
    
    return (
        <div>
            {text}
            {options && (
                <div>
                    <button className="text-white bg-green-500" onClick={() => confirmationFun()}>Yes</button>
                    <button className="text-white bg-red-500" onClick={(e) => cancleFun(e.target)}>No</button>
                </div>
            )}
        </div>
    );
}

export default Popup;
